-- ----------------------------
-- Table structure for c_attack
-- ----------------------------
DROP TABLE IF EXISTS `c_attack`;
CREATE TABLE `c_attack` (
  `keyId` int(11) NOT NULL,
  `type` int(11) NOT NULL DEFAULT '1' COMMENT '当前进攻单元的类型。',
  `tankTime` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '下一手攻击是本方坦克时，在自身攻击最后一步后触发本方坦克的攻击',
  `zhancTime` float(11,2) NOT NULL DEFAULT '0.00',
  `huopTime` float(11,2) NOT NULL DEFAULT '0.00',
  `huojTime` float(11,2) NOT NULL DEFAULT '0.00',
  `rivalTankTime` float(11,2) NOT NULL DEFAULT '0.00' COMMENT '下一手攻击是对方坦克时，在自身攻击最后一步后触发对方坦克的攻击',
  `rivalZhancTime` float(11,2) NOT NULL DEFAULT '0.00',
  `rivalHuopTime` float(11,2) NOT NULL DEFAULT '0.00',
  `rivalHuojTime` float(11,2) NOT NULL DEFAULT '0.00',
  PRIMARY KEY (`keyId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ----------------------------
-- Records of c_attack
-- ----------------------------

