-- Table structure for c_tank
-- ----------------------------
DROP TABLE IF EXISTS `c_tank`;
CREATE TABLE `c_tank` (
  `tankId` int(11) NOT NULL,
  `recoil` varchar(50) COLLATE utf8_bin NOT NULL COMMENT '坦克后坐力参数，[后退的步数，后退每步需要的时间，后退每步的距离，后退一步后等待时间，返回原地的时间]。对于火箭，第1、4个参数无效',
  `ammoName` char(20) COLLATE utf8_bin NOT NULL COMMENT '发射的炮弹的动画名称',
  `hurtName` char(20) COLLATE utf8_bin NOT NULL COMMENT '对方受到自己炮弹攻击的受击动画',
  `hurtName2` char(20) COLLATE utf8_bin NOT NULL,
  `fireSound` char(20) COLLATE utf8_bin DEFAULT NULL,
  `hitSound` char(20) COLLATE utf8_bin DEFAULT NULL,
  `dieSound` char(20) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`tankId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

