  `awardId` int(11) NOT NULL,
  `activityId` int(11) NOT NULL COMMENT '活动编号',
  `openBegin` int(11) NOT NULL DEFAULT '0' COMMENT '开服第几天开启 ：0无， 1 为开服第一天（当天）',
