  `plat` int(11) NOT NULL DEFAULT '0' COMMENT '0所有平台 1.安卓 2.IOS',
  `serverBegin` int(11) NOT NULL DEFAULT '0' COMMENT '第一天填写1',
  `serverEnd` int(11) NOT NULL DEFAULT '0' COMMENT '开服几天之内可以开',
  PRIMARY KEY (`keyId`)
