  `count` int(11) NOT NULL COMMENT '掉落物品单位',
  `awardList` varchar(656) COLLATE utf8_bin NOT NULL DEFAULT '[]' COMMENT '奖品或者物品集合[[itemType,itemId,itemCount,概率]...]',
  `displayCount` int(11) NOT NULL DEFAULT '0' COMMENT '显示数量',
