  `ironOut` int(11) NOT NULL DEFAULT '0' COMMENT '铁矿产出(每小时)',
  `oilOut` int(11) NOT NULL DEFAULT '0' COMMENT '石油产出(每小时)',
  `copperOut` int(11) NOT NULL DEFAULT '0' COMMENT '铜矿产出(每小时)',
  `siliconOut` int(11) NOT NULL DEFAULT '0' COMMENT '硅矿产出(每小时)',
