-- Table structure for s_function_plan
-- ----------------------------
DROP TABLE IF EXISTS `s_function_plan`;
CREATE TABLE `s_function_plan` (
  `keyId` int(11) NOT NULL AUTO_INCREMENT,
  `funId` int(11) NOT NULL DEFAULT '0' COMMENT '1编制，2能晶，3军团防守战，4军工科技',
  `funname` char(11) COLLATE utf8_bin NOT NULL DEFAULT '' COMMENT '代码方法名称',
  `dayiy` int(11) NOT NULL DEFAULT '0' COMMENT '开服多久之后可以开启功能。',
  `rules` varchar(256) COLLATE utf8_bin NOT NULL DEFAULT '*' COMMENT '*表示所有服均开，0所有服都不开，1-9,11-20:表示1到9服，11到20开放，逗号分隔',
  `desc` char(128) COLLATE utf8_bin DEFAULT NULL COMMENT '功能描叙',
