-- ----------------------------
-- Table structure for s_hero
-- ----------------------------
DROP TABLE IF EXISTS `s_hero`;
CREATE TABLE `s_hero` (
  `heroId` int(11) NOT NULL,
  `heroName` char(32) COLLATE utf8_bin NOT NULL COMMENT '将领名称',
  `type` int(11) NOT NULL COMMENT '1.文官 2.武官',
  `star` int(11) NOT NULL COMMENT '星级 星星月亮太阳s，SS （1-N ）',
  `level` int(11) NOT NULL DEFAULT '0' COMMENT 's-ss级武将有等级之分 1-5',
  `resolveId` int(11) NOT NULL COMMENT '分解ID,对应s_awards表中的awardId',
  `soul` int(11) NOT NULL DEFAULT '0' COMMENT '进阶需要灵魂石数量',
  `canup` int(11) NOT NULL COMMENT '0不能升级 1可升级',
  `meta` char(128) COLLATE utf8_bin DEFAULT '[]' COMMENT '升级需要材料[[type,id,count]...]',
  `order` int(11) NOT NULL DEFAULT '0' COMMENT '将领顺序，数字小的厉害',
  `tankCount` int(11) NOT NULL,
  `attr` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '武将属性 [[id,value]]',
  `skillName` char(20) COLLATE utf8_bin NOT NULL,
  `skillId` int(11) NOT NULL COMMENT '技能ID,对应技能表里面的ID',
  `skillValue` int(11) NOT NULL COMMENT '技能的效果值(同一技能的效果值有高低）',
  `skillDesc` char(30) COLLATE utf8_bin NOT NULL,
  `compound` int(11) NOT NULL DEFAULT '0',
  `probability` int(11) NOT NULL DEFAULT '0' COMMENT '同届权重',
  `asset` char(255) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`heroId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

