  `exp` int(20) NOT NULL COMMENT '增加经验',
  `up_weight` int(20) NOT NULL COMMENT '上升权重',
  `up_min` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '上升最小值',
  `up_max` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '上升最大值',
  `down_weight` int(20) NOT NULL COMMENT '下降权重',
  `down_min` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '下降最小值',
  `down_max` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '下降最大值',
  PRIMARY KEY (`kind`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

