  `form` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '阵型 [[id,count],[id,count],[]] 配满6个，没有的直接配成[]',
  `hero` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '将领 [id,lv]',
  `attr` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '部队属性[[生命,攻击,命中,闪避,暴击,抗暴,穿刺,防护,攻击万分比,减伤万分比]]',
  `assetData` char(50) COLLATE utf8_bin NOT NULL COMMENT '[tankId, buildId, tankNum]。tankId表示放置tank的id值；buildId表示如果是建筑，则表示建筑的id；tankNum表示是建筑是，需要显示的tank的id',
