DROP TABLE IF EXISTS `s_prop`;
CREATE TABLE `s_prop` (
  `propId` int(11) NOT NULL,
  `propName` char(30) COLLATE utf8_bin NOT NULL COMMENT '道具名',
  `nameSuffix` char(30) COLLATE utf8_bin DEFAULT NULL COMMENT '道具名后缀',
  `tag` int(11) NOT NULL COMMENT '分类标签 1.资源 2.增益 3.成长 4.特殊',
  `color` int(11) NOT NULL COMMENT '颜色 1.白 2.绿 3.蓝 4.紫 5.橙',
  `border` int(11) NOT NULL DEFAULT '0' COMMENT '边框光效 0.无光效 1.紫色 2.橙色',
  `price` int(11) NOT NULL,
  `canBuy` int(11) NOT NULL DEFAULT '0' COMMENT '能否在商店购买 0.不能 1.可以',
  `canBuild` int(11) NOT NULL COMMENT '能否制造 0.不能制造 1.可以制造',
  `canUse` int(11) NOT NULL COMMENT '能否使用 0.不能 1.可以使用',
  `arenaScore` int(11) NOT NULL COMMENT '竞技场兑换所需的积分，0表示不可兑换',
  `stoneCost` int(11) NOT NULL COMMENT '制造车间制造时消耗的宝石数量',
  `skillBook` int(11) NOT NULL COMMENT '制造车间制造时消耗的技能书数量',
  `heroChip` int(11) NOT NULL COMMENT '制造车间制造时消耗的神将碎片数量',
  `buildTime` int(11) NOT NULL COMMENT '制造车间制造时间',
  `effectType` int(11) NOT NULL COMMENT '1.获得资源、物品 2.获得效果加成 3.加速 4.随机箱子 5.普通道具物品 6.特殊功能道具7.军团战事福利箱',
  `effectValue` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '效果值，根据不同的effectType，效果值不同 [1,3,2]',
  `type` int(11) NOT NULL,
  `desc` char(60) COLLATE utf8_bin NOT NULL COMMENT '描述',
  `asset` char(20) COLLATE utf8_bin DEFAULT NULL,
  `batchUse` int(11) NOT NULL COMMENT '能否批量使用。1、可以。2、不能',
  PRIMARY KEY (`propId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

