-- ----------------------------
-- Table structure for s_tank
-- ----------------------------
DROP TABLE IF EXISTS `s_tank`;
CREATE TABLE `s_tank` (
  `tankId` int(11) NOT NULL DEFAULT '0',
  `name` char(20) COLLATE utf8_bin NOT NULL,
  `type` int(11) NOT NULL COMMENT '坦克类型 1.坦克 2.战车 3.火炮 4.火箭',
  `subType` int(11) NOT NULL COMMENT '克制关系中的类型',
  `grade` int(11) NOT NULL COMMENT '坦克品质 1.白 2.绿 3.蓝 4.紫 5.橙 6.红',
  `border` int(11) NOT NULL DEFAULT '0' COMMENT '边框光效 0.无光效 1.紫色 2.橙色',
  `honorScore` int(11) NOT NULL DEFAULT '0' COMMENT '荣誉积分',
  `warScore` int(11) NOT NULL COMMENT '百团混战贡献度',
  `canBuild` int(11) NOT NULL COMMENT '能否建造 0.可以建造 1.不能建造',
  `canRefit` int(11) NOT NULL COMMENT '能否改装 0.不能改装 1.可以改装',
  `buildTime` int(11) NOT NULL COMMENT '建造时间(秒)',
  `lordLv` int(11) NOT NULL COMMENT '角色等级要求',
  `factoryLv` int(11) NOT NULL COMMENT '战车工厂等级要求',
  `refitLv` int(11) NOT NULL COMMENT '改装到下一级坦克需要的战车工厂等级',
  `refitId` int(11) NOT NULL COMMENT '能够改装成的tank id',
  `drawing` int(11) NOT NULL COMMENT '生产需要的设计图纸id',
  `book` int(11) NOT NULL COMMENT '生产需要的技能书数量',
  `iron` int(11) NOT NULL COMMENT '生产坦克的铁消耗',
  `oil` int(11) NOT NULL COMMENT '生产坦克的石油消耗',
  `copper` int(11) NOT NULL COMMENT '生产坦克的铜消耗',
  `silicon` int(11) NOT NULL COMMENT '生产坦克的硅消耗',
  `repair` int(11) NOT NULL COMMENT '维修消耗(宝石)',
  `payload` int(11) NOT NULL COMMENT '载重',
  `fight` int(11) NOT NULL COMMENT '单体战斗力',
  `attackMode` int(11) NOT NULL COMMENT '攻击方式 1.横排 2.竖排 3.全体 4.单体五连击',
  `attack` int(11) NOT NULL COMMENT '攻击属性',
  `hp` bigint(20) NOT NULL COMMENT '生命',
  `hit` int(11) NOT NULL COMMENT '命中 千分数',
  `dodge` int(11) NOT NULL COMMENT '物理闪避 千分数',
  `crit` int(11) NOT NULL COMMENT '暴击 千分数',
  `critDef` int(11) NOT NULL COMMENT '抗暴 千分数',
  `impale` int(11) NOT NULL COMMENT '穿刺 ',
  `defend` int(11) NOT NULL COMMENT '防护',
  `attckFactor` float NOT NULL COMMENT '攻击战力系数',
  `hpFactor` float NOT NULL COMMENT '生命战力系数',
  `impaleFactor` int(11) NOT NULL COMMENT '坦克穿刺系数',
  `staffingExp` int(11) NOT NULL COMMENT '击毁坦克获得的编制经验',
  `restriction` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '克制关系 [[subtype, value]] -- [[1, 20],[2, -20]]',
  `aura` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '光环 [buffId, buffId]',
  `asset` varchar(255) COLLATE utf8_bin NOT NULL,
  PRIMARY KEY (`tankId`),
  UNIQUE KEY `only_index` (`tankId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

-- ----------------------------
-- Records of s_tank
-- ----------------------------

-- ----------------------------
-- Table structure for s_task
