DROP TABLE IF EXISTS `s_task`;
CREATE TABLE `s_task` (
  `taskId` int(11) NOT NULL COMMENT '任务编号',
  `type` int(11) NOT NULL COMMENT '1.主线任务 2.日常任务 3.日常活跃',
  `typeChild` int(11) NOT NULL DEFAULT '0' COMMENT '主线任务下面 ： 1基地 2角色 3资源',
  `triggerId` int(11) NOT NULL DEFAULT '0' COMMENT '触发该任务的任务ID',
  `taskStar` int(11) NOT NULL DEFAULT '0' COMMENT '星级',
  `probability` int(11) NOT NULL,
  `taskName` char(32) COLLATE utf8_bin NOT NULL COMMENT '任务名称',
  `cond` int(11) NOT NULL COMMENT '1.铁升级2.油升级.3铜升级4.硅升级5.宝石升级6.司令部7.战车工厂8.改装工厂9.科技馆10.仓库11.制造车间12.生产坦克13.战胜资源点16战胜关卡17声望提升18军衔提升19攻打玩家20攻打资源点21铁产量22油产量23铜产量24铁建25油建26铜建27硅建28宝石建29战车工厂建30仓库建31升级建筑32升级装备33金币消费34研发科技35挑战竞技场37.完成配件探险38.完成极限探险39.完成装备探险40完成军团试炼41完成废墟探宝（限时副本）42.兑换军团道具43进行军团捐献44进阶将领45招募将领46领取军团试炼箱47驻军48升级装备49强化配件50建造改装工厂51建造科技馆52建造制造车间',
  `schedule` int(11) NOT NULL COMMENT '任务进度完成值,为分母例如： 0/3',
  `finishCount` int(11) NOT NULL DEFAULT '0' COMMENT '重复完成次数',
  `exp` int(11) NOT NULL DEFAULT '0' COMMENT '经验',
  `live` int(11) NOT NULL COMMENT '增加活跃度',
  `awardList` char(128) COLLATE utf8_bin NOT NULL COMMENT '物品道具奖励[[itemType,itemId,itemCount]...]',
  `param` char(64) COLLATE utf8_bin NOT NULL DEFAULT '[]',
  `desc` char(128) COLLATE utf8_bin NOT NULL,
  `asset` char(32) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`taskId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

